// https://leetcode.com/problems/longest-ideal-subsequence/description

#include <iostream>
#include <vector>
#include <cmath>

using namespace std;


class Solution {
public:
    int longestIdealString(string s, int k) {
        vector<int> longest_positions;
        int longest_seq_val, longest_seq_index;
        for (int i=0; i<s.length(); i++) {
            if (i==0) {
                longest_positions.push_back(1);
                longest_seq_val = 1;
                longest_seq_index = 0;
            } else {
                char cur_char = s[i];
                if (abs(cur_char - s[longest_seq_index]) <= k) {
                    longest_seq_val++;
                    longest_seq_index = i;
                    longest_positions.push_back(longest_seq_val);
                } else {
                    int cur_max = 1;
                    for (int j=i-1;j>=0;j--) {
                        char j_char = s[j];
                        int dist = abs(cur_char-j_char);
                        if (dist <= k) {
                            int new_length = longest_positions[j] + 1;
                            if (new_length > cur_max) {
                                cur_max = new_length;
                            }
                        }
                    }
                    if (cur_max > longest_seq_val) {
                        longest_seq_val = cur_max;
                        longest_seq_index = i;
                    }
                    longest_positions.push_back(cur_max);
                }                
            }
        }
        int max_res = 1;
        for (int i=0; i<s.length(); i++) {
            if (longest_positions[i] > max_res) {
                max_res = longest_positions[i];
            }
        }
        return max_res;
    }
};

int main()
{
    Solution *s = new Solution();

    // Example 1
    // s = "acfgbd", k = 2. Result 4

    string ss = "";

    int res = s->longestIdealString(ss, 8);

    cout << "res: " << res << endl;
    return 0;
}
